import React from 'react'
import { useLocation } from 'react-router-dom';

const Detail = () => {
  const location = useLocation()
  const { title,content,imageUrl,author } = location.state;
  return (
    <div>
    return (
      <div>
        <h1>{title}</h1>
        <p>{content}</p>
        <img src={imageUrl} alt="" />
        <h5>{author}</h5>
      </div>
    </div>
  )
}

export default Detail;
